			shellScript = "# Sets the target folders and the finalframework product.\n# 如果工程名称和Framework的Target名称不一样的话，要自定义FMKNAME# 例如: FMK_NAME = \"MyFramework\"\nFMK_NAME=${PROJECT_NAME}\necho \">>>>>>>>>>>>>>\"\necho \">>> FMK_NAME = \"$FMK_NAME\n\n# Install dir will be the final output tothe framework.\n# The following line create it in the rootfolder of the current project.\nINSTALL_DIR=${SRCROOT}/Products/${FMK_NAME}.framework\necho \">>> INSTALL_DIR = \"$INSTALL_DIR\n\n# Working dir will be deleted after theframework creation.\nWRK_DIR=build\necho \">>> WRK_DIR = \"$WRK_DIR\n\nDEVICE_DIR=${WRK_DIR}/Release-iphoneos/${FMK_NAME}.framework\necho \">>> DEVICE_DIR = \"$DEVICE_DIR\n\nSIMULATOR_DIR=${WRK_DIR}/Release-iphonesimulator/${FMK_NAME}.framework\necho \">>> SIMULATOR_DIR = \"$SIMULATOR_DIR\n\n# -configuration ${CONFIGURATION}\n# Clean and Building both architectures.\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos clean build\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator clean build\n\n# Cleaning the oldest.\necho \">>> Cleaning the oldest.\"\n\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\nmkdir -p \"${INSTALL_DIR}\"\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\n\n# Uses the Lipo Tool to merge both binaryfiles (i386 + armv6/armv7) into one Universal final product.\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\nrm -r \"${WRK_DIR}\"\nopen \"${INSTALL_DIR}\"\n\n";
